import heyday from "../heyday.png";
import './Top-Section.css'

const Top = () => {
  return (
    <div>
      <img src={heyday} alt="logo" />
      <div>

      <p className="header">WHAT WE DO..</p>
      <p>
        We Help Local Dental Practices To Acquire More Leads Through Social
        Media
      </p>
      <div>
        <p>Book Your Call Now</p>
        <p>Click here to book a call with us</p>
      </div>
      </div>
    </div>
  );
};

export default Top;
